import React, { useEffect, useState } from 'react';
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

import { useRouter } from 'next/router';
import axios from 'axios';

const createInvoice = (rental, space, renter, owner) => {
  let costMinusIVA = (rental.cost / 1.21).toFixed(2);
  let costIVA = (rental.cost - costMinusIVA).toFixed(2);
  let costMinusComission = (costMinusIVA / 1.06).toFixed(2);
  let costComission = (costMinusIVA - costMinusComission).toFixed(2);
  return {
    content: [
      {
        columns: [
          {
            width: 181,
            height: 64,
            image: "data:image/png;base64,",


          },
          {
            stack: [
              {
                alignment: 'right',
                text: "Stacking Up"
              },
              {
                alignment: 'right',
                text: "Avenida Reina Mercedes,"
              },
              {
                alignment: 'right',
                text: "Sevilla, 41012"
              }
            ]
          }
        ]
      },
      {
        text: 'Alquiler de espacio',
        alignment: 'center',
        fontSize: 24,
        bold: true,
        margin: [0, 30, 0, 0],
      },
      {
        margin: [0, 100, 0, 0],
        layout: 'lightHorizontalLines', // optional
        table: {
          // headers are automatically repeated if the table spans over multiple pages
          // you can declare how many rows should be treated as headers
          headerRows: 1,
          widths: [100, '*', '*'],

          body: [
            [{ text: 'Factura', bold: true, fontSize: 18 }, ' ', ' '],
            ['nº Factura:', rental.id, { text: `${renter.name} ${renter.surname}`, bold: true }],
            ['Fecha inicio:', `${new Date(rental.initialDate).toLocaleDateString()} ${new Date(rental.initialDate).toLocaleTimeString()}`, ' '],
            ['Fecha fin: ', `${new Date(rental.finalDate).toLocaleDateString()} ${new Date(rental.finalDate).toLocaleTimeString()}`, ' ']
          ]
        }
      },
      {
        margin: [0, 100, 0, 0],
        layout: 'lightHorizontalLines', // optional
        table: {
          // headers are automatically repeated if the table spans over multiple pages
          // you can declare how many rows should be treated as headers
          headerRows: 1,
          widths: [150, '*', 50],

          body: [
            [{ text: 'Item', bold: true, fontSize: 12 }, { text: 'Descripción', bold: true, fontSize: 12 }, { text: 'Precio', bold: true, fontSize: 12, alignment: 'right' }],
            ['Alquiler', `Desde: ${new Date(rental.initialDate).toLocaleDateString()} ${new Date(rental.initialDate).toLocaleTimeString()}\nHasta: ${new Date(rental.finalDate).toLocaleDateString()} ${new Date(rental.finalDate).toLocaleTimeString()}`, { text: costMinusComission, alignment: 'right' }],
            ['Comisión', 'Importe comisiones 6%', { text: costComission, alignment: 'right' }],
            ["", { text: 'Subtotal', bold: true, alignment: 'right' }, { text: costMinusIVA, bold: true, alignment: 'right' }],
            ["", { text: 'IVA(21%)', bold: true, alignment: 'right' }, { text: costIVA, bold: true, alignment: 'right' }],
            ["", { text: 'Total', bold: true, alignment: 'right' }, { text: rental.cost.toFixed(2), bold: true, alignment: 'right' }],
          ]
        }
      }
    ],
    info: {
      title: 'Factura',
      author: 'StackingUp',
      subject: 'Factura de alquiler del espacio'
    }
  }
}

function Invoice({ user }) {
  const router = useRouter();

  const [invoice, setInvoice] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const rental = await axios.get(`${process.env.NEXT_PUBLIC_DATA_API_URL || 'http://localhost:4100'}/api/v1/rentals/${router.query.id}`)
        .then(res => {
          return res.data;
        }).catch(err => {
          router.back();
        })

      const space = await axios.get(`${process.env.NEXT_PUBLIC_DATA_API_URL || 'http://localhost:4100'}/api/v1/spaces/${rental.spaceId}`)
        .then(res => {
          return res.data;
        }).catch(err => {
          console.log("Error retrieving the space")
        });

      const renter = await axios.get(`${process.env.NEXT_PUBLIC_DATA_API_URL || 'http://localhost:4100'}/api/v1/users/${rental.renterId}`)
        .then(res => {
          return res.data;
        }).catch(err => {
          console.log("Error retrieving the renter user")
          return { name: "Desconocido" }
        });

      const owner = await axios.get(`${process.env.NEXT_PUBLIC_DATA_API_URL || 'http://localhost:4100'}/api/v1/users/${space.ownerId}`)
        .then(res => {
          return res.data;
        }).catch(err => {
          console.log("Error retrieving the owner user")
          return { name: "Desconocido" }
        });

      const invoice = createInvoice(rental, space, renter, owner);

      const pdfDocGenerator = pdfMake.createPdf(invoice)
      pdfDocGenerator.getBase64((data) => {
        setInvoice(data)
      })
    }
    fetchData();
  }, [])

  return (
    <>
      {
        invoice &&
        <object className='h-screen flex justify-center' height="100%">
          <embed id="pdfID" type="text/html" className='w-11/12 h-11/12' src={`data:application/pdf;base64,${invoice}`} />
        </object>
      }

    </>
  )
}


export default Invoice